import Header from "./Header";
import Home from "./components/Home";
import About from "./components/About";

function App() {
    let component
    switch (window.location.pathname) {
        case "/":
            component = <Home />;
            break;
        case "/About":
            component = <About />;
            break;


    }
    return (
        <>
            <Header />
            {component}
        </>)

}

export default App;
